import React, { Component } from "react";
import Screen from "./Screen";
import Buttons from "./Buttons";
class Calculator extends Component {
   constructor(props) {
     super(props)

     this.state = {
        problem:5454655,
     }
   }

  render() {
    return (
      <div id="calculator">
        <Screen problem={this.state.problem}/>
        <Buttons />
      </div>
    );
  }
}

export default Calculator;
